import Link from 'next/link'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSignInAlt, faHome, faUser } from '@fortawesome/free-solid-svg-icons';

const Header = () => (
    <div className={'Nav'}>
        <Link href="/">
          <a><FontAwesomeIcon icon={ faSignInAlt } /></a>
        </Link>
        <Link href="/login">
            <a><FontAwesomeIcon icon={ faHome } /></a>
        </Link>
        <Link href="/user">
            <a><FontAwesomeIcon icon={ faUser } /></a>
        </Link>
        <style jsx>{`
            a {
                background: red;
            }
        `}</style>
    </div>
)

export default Header
